import React, { Component } from 'react';
import { BrowserRouter, Router, Route ,Link } from "react-router-dom";
import signUpForm from "./pages/signUpForm";
import signInForm from "./pages/signInForm";
import './App.css';

class App extends Component {
  render(){
    return (
      <BrowserRouter>
        <div className="App">
        <div className="App__Aside">
          Hi 
          My name is Ali Yaghoobian
        </div>

        <div className="App__Form">
          <div className="PageSwitcher">
            <a href="#" className="PageSwitcher__Item ">Sign In</a>
            <a href="#" className="PageSwitcher__Item PageSwitcher__Item--Active">Sign Up</a>
          </div>

          <div className="FormTitle">
            <NavLink to ="/sign-in" activeClassName="FormTitle__Link--Active"
             className="FormTitle__Link">Sign In</NavLink> or <NavLink to ="/sign-up" 
            activeClassName="FormTitle__Link--Active" className="FormTitle__Link">Sign Up</NavLink>
          </div>
           <Route exact path="/sign-up" component={signUpForm}> 

          </Route>

          <Route path="/sign-in" component={signInForm}>
          </Route>
          </div>

        </div>
      </BrowserRouter>
    );
  }

}

export default App;
